import React from 'react';

export function FieldCheck(props) {
    if (!props.isTouched || props.isValid) {
        return (<div><p></p></div>);
    }

    return (
        //<h6 align="left" color="red">{props.message}</h6>
        <div align="left">
            <font color="red">{props.message}</font>
        </div>
    );
}

export function FieldCheck2(props) {
    if (!props.message) {
        return (<div><p></p></div>);
    }

    return (
        <div align="left">
            <font color="red">{props.message}</font>
        </div>
    );
}

export function FieldCheck3(props) {
    if (props.isValid) {
        return (<div><p></p></div>);
    }

    if (!props.message) {
        return (<div><p></p></div>);
    }

    return (
        <div align="left">
            <font color="red">{props.message}</font>
        </div>
    );
}

export default FieldCheck;
